function fetchAndRender(e){fetch(e+".json").then(e=>e.json()).then(n=>{let t=document.getElementById(e+"-template").innerHTML,d=Handlebars.compile(t),r=d(n);document.getElementById(e).innerHTML=r})}document.addEventListener("DOMContentLoaded",()=>{fetchAndRender("apps"),fetchAndRender("links"),fetchAndRender("providers")});